INSERT INTO `Furniture_Items` VALUES (6,4,'TARVA 塔瓦床架','床架，松木/鲁瑞，150x200 厘米。床架是具有现代特色的斯堪的纳维亚传统家具，此类家具一直采用简洁的设计风格，并由未经处理的木材制作而成。这款产品设计经典，可与其他各类家具和谐搭配。\n12\n商场4层D8311','inactive','2024-08-21 03:07:13','2024-08-24 15:49:50'),(8,5,'胡桃木柜子','商场1层103','active','2024-08-21 06:11:29','2024-08-21 06:11:29'),(9,5,'金丝楠木书桌','商场1层104','active','2024-08-21 06:12:04','2024-08-21 06:12:04'),(10,5,'金丝楠木书桌','商场1层104','active','2024-08-22 10:03:10','2024-08-22 10:03:10'),(11,5,'金丝楠木衣柜','商场1层104','active','2024-08-22 10:08:41','2024-08-22 10:08:41'),(12,5,'金丝楠木衣柜','商场1层104','active','2024-08-22 10:09:09','2024-08-22 10:09:09'),(13,5,'金丝楠木衣柜1','商场1层104','active','2024-08-22 10:10:44','2024-08-22 10:10:44'),(14,5,'金丝楠木衣柜2','商场1层104','active','2024-08-22 10:11:05','2024-08-22 10:11:05'),(15,5,'金丝楠木衣柜3','商场1层104','active','2024-08-22 10:11:19','2024-08-22 10:11:19'),(16,5,'金丝楠木衣柜3','商场1层104','active','2024-08-22 10:12:04','2024-08-22 10:12:04'),(17,5,'实木办公室座椅','','active','2024-08-23 01:26:38','2024-08-23 01:26:38'),(19,5,'实木沙发1','实木设计, 适合家庭使用','active','2024-08-23 01:46:24','2024-08-23 01:46:24'),(20,5,'实木沙发1','实木设计, 适合家庭使用','active','2024-08-23 01:47:36','2024-08-23 01:47:36'),(22,5,'TARVA床架','TARVA 塔瓦 床架是具有现代特色的斯堪的纳维亚传统家具，此类家具一直采用简洁的设计风格，并由未经处理的木材制作而成。这款产品设计经典，可与其他各类家具和谐搭配。','active','2024-08-23 03:13:22','2024-08-23 03:13:22'),(23,6,'TARVA 塔瓦床架334','床架，松木/鲁瑞，150x200 厘米。床架是具有现代特色的斯堪的纳维亚传统家具，此类家具一直采用简洁的设计风格，并由未经处理的木材制作而成。这款产品设计经典，可与其他各类家具和谐搭配。\n\n商场4层D8311','active','2024-08-23 06:48:00','2024-08-24 16:01:21'),(24,6,'诺德希萨 开放式衣柜','开放式衣柜，带滑门，竹，120x186 厘米\n\n这个衣柜以经典斯堪的纳维亚家具设计为灵感，有着简洁的线条和通透的结构。除了可以挂放衣服和个人物品，它也是家中的一件个性展示品。\n\n商场3楼 C8311','active','2024-08-23 06:55:09','2024-08-23 06:55:09'),(25,6,'SKRUVBY 餐边柜','白色，120x38x90 厘米 SKRUVBY 斯库比 系列具有传统外观，并配有风格匹配的独立储物单元。 这款餐边柜配有暖色调橡木纹理顶板，搁板可提供开放式储物空间，而抽屉及带凹槽的柜门后方则可用于封闭式储物。\n\n商场2楼 B8316','active','2024-08-23 06:58:45','2024-08-23 06:58:45'),(26,6,'伊克多兰 伸缩形餐桌','橡木，120/180x80 厘米\n一款经久耐用的餐桌，让你可以轻松享受丰盛大餐。一个人便可轻松展开桌子，支腿均位于桌角处，有足够的空间来摆放椅子。\n\n商场5楼 E8006','active','2024-08-23 07:02:53','2024-08-23 07:02:53'),(27,6,'阿颂达 扶手椅','ÅRSUNDA 阿颂达 扶手椅轻巧通透，坐感舒适，可在家中任意位置使用。 简约统一的外观可出色融入不同的家居空间，靠背略带弹性，可提供舒适支撑。\n\n商场5层 E8007','active','2024-08-23 07:06:20','2024-08-23 07:06:20'),(28,6,'爱克托 单人沙发和脚凳','单人沙发/扶手椅和脚凳，凯尔士 米色/多色\n\n备受喜爱的 EKTORP 爱克托 座椅采用经典设计，搭配厚实舒适的靠垫。垫套易于更换，不妨额外再购买一两个垫套，根据心情或季节随意更换。\n\n商场5层 B8005','active','2024-08-23 07:08:52','2024-08-23 07:08:52'),(29,20,'科技电脑桌','科技风格电脑桌, 支持多种高度调节, 稳定舒适','active','2024-08-27 14:21:27','2024-08-27 14:21:55'),(30,20,'PAX 帕克思 衣柜组合','简单点就好。这款基础式衣柜能帮助你打造自己的理想衣柜，并为衣柜升级留出可放置更多内配件的空间。','active','2024-08-28 00:28:44','2024-08-28 00:29:04'),(31,6,'软包床架','','active','2024-08-28 00:33:44','2024-08-28 00:33:44'),(32,20,'PAX 帕克思 木质衣柜','这是一款适合叠衣爱好者的衣柜！内部设有大量搁板空间，适合收纳大多数可以折叠、卷起或不适合放在抽屉中的物品。','active','2024-08-28 00:40:32','2024-08-28 00:40:32'),(33,20,'PAX 帕克思 柜子','这是一款适合叠衣爱好者的衣柜！内部设有大量搁板空间，适合收纳大多数可以折叠、卷起或不适合放在抽屉中的物品。','active','2024-08-28 02:42:19','2024-08-28 02:42:19'),(34,20,'黑色桌子','实木材质...','active','2024-08-28 02:46:36','2024-08-28 02:46:36'),(35,20,'测试1','','active','2024-09-05 09:37:04','2024-09-05 09:37:04'),(36,20,'测试1','111','active','2024-09-06 03:08:21','2024-09-06 03:08:21'),(37,20,'测试家具','111','active','2024-09-06 03:20:20','2024-09-06 03:20:20'),(38,20,'测试','11','active','2024-09-06 06:00:50','2024-09-06 06:00:50');
